import React from "react";
import { Cloudinary } from "@cloudinary/url-gen";
import { backgroundRemoval } from "@cloudinary/url-gen/actions/effect";

const ClothingImageCard = ({ clothingType, image }) => {
  const cloud = new Cloudinary({
    cloud: {
      cloudName: "dmjzidsiy",
    },
  });

  let transformedImage = null; //making sure my varible is empty

  if (image) {
    transformedImage = cloud
      .image(image.replace(/^.*\/upload\//, "")) //im removing everything in the URL string, up until "/upload/"
      .effect(backgroundRemoval()) // apply remove bg
      .toURL(); // create usable image URL
  }

  return (
    <div className="clothing-card">
      <h3>{clothingType}</h3>

      {transformedImage && (
        <img
          src={transformedImage}
          alt={clothingType}
          style={{ width: "200px", borderRadius: "8px" }}
        />
      )}
    </div>
  );
};

export default ClothingImageCard;
